[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT ?category ?en_label ?ja_label
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?category a owl:Class ;
            rdfs:subClassOf nando:1000001 ;
            rdfs:label ?en_label ;
            rdfs:label ?ja_label .
  FILTER(LANG(?en_label) = "en")
  FILTER(LANG(?ja_label) = "ja" && !REGEX(STR(?ja_label), "^[ぁ-ん]+$"))
}
ORDER BY ?en_label"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT DISTINCT ?gene ?symbol ?hgnc_id
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?gene a cvo:Gene ;
        cvo:symbol ?symbol ;
        cvo:hgnc_id ?hgnc_id .
  FILTER(?symbol = "TP53")
}
LIMIT 10"}}]

[{"name": "mcp__togomcp__search_chembl_target", "input": {"query": "kinase", "limit": 20}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX bibo: <http://purl.org/ontology/bibo/>

SELECT DISTINCT ?molecule ?moleculeLabel ?chemblId ?target ?targetLabel ?activityType ?value ?units ?pmid ?year
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:hasMolecule ?molecule ;
            cco:standardType ?activityType ;
            cco:hasAssay ?assay ;
            cco:hasDocument ?document .

  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .

  ?assay cco:hasTarget ?target .

  ?target rdfs:label ?targetLabel .

  ?targetLabel bif:contains "'kinase'" option (score ?sc) .

  ?document bibo:pmid ?pmid ;
            bibo:year ?year .

  OPTIONAL { ?activity cco:standardValue ?value }
  OPTIONAL { ?activity cco:standardUnits ?units }

  FILTER(?activityType IN ("IC50", "Ki", "Kd"))
  FILTER(?year >= 2020)
}
ORDER BY DESC(?year) DESC(?sc)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?moleculeLabel ?chemblId ?target ?targetLabel ?mechanismType
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?mechanism a cco:Mechanism ;
             cco:hasMolecule ?molecule ;
             cco:hasTarget ?target ;
             cco:mechanismActionType ?mechanismType .

  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .

  ?target rdfs:label ?targetLabel .

  ?targetLabel bif:contains "'kinase'" option (score ?sc) .

  FILTER(?mechanismType = "INHIBITOR")
}
ORDER BY DESC(?sc)
LIMIT 30"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT ?molecule ?moleculeLabel ?chemblId ?phase ?atc
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  VALUES ?chemblId { "CHEMBL3916717" "CHEMBL4802154" "CHEMBL5095028" "CHEMBL3544960" "CHEMBL3545243" "CHEMBL3182621" "CHEMBL3545383" }

  ?molecule cco:chemblId ?chemblId ;
            rdfs:label ?moleculeLabel .

  OPTIONAL { ?molecule cco:highestDevelopmentPhase ?phase }
  OPTIONAL { ?molecule cco:atcClassification ?atc }
}
ORDER BY DESC(?chemblId)"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?moleculeLabel ?chemblId ?target ?targetLabel ?activityType ?value ?units
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  VALUES ?chemblId { "CHEMBL3916717" "CHEMBL4802154" "CHEMBL5095028" }

  ?molecule cco:chemblId ?chemblId ;
            rdfs:label ?moleculeLabel ;
            cco:hasActivity ?activity .

  ?activity cco:standardType ?activityType ;
            cco:hasAssay/cco:hasTarget ?target .

  ?target rdfs:label ?targetLabel .

  OPTIONAL { ?activity cco:standardValue ?value }
  OPTIONAL { ?activity cco:standardUnits ?units }

  FILTER(?activityType IN ("IC50", "Ki", "Kd", "EC50"))
  FILTER(xsd:decimal(?value) < 1000)
}
ORDER BY ?chemblId ?activityType
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?moleculeLabel ?chemblId ?target ?targetLabel ?mechanismType ?phase
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?mechanism a cco:Mechanism ;
             cco:hasMolecule ?molecule ;
             cco:hasTarget ?target ;
             cco:mechanismActionType ?mechanismType .

  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .

  ?target rdfs:label ?targetLabel .

  ?targetLabel bif:contains "('tyrosine' AND 'kinase')" option (score ?sc) .

  OPTIONAL { ?molecule cco:highestDevelopmentPhase ?phase }

  FILTER(?mechanismType = "INHIBITOR")
  FILTER(xsd:integer(SUBSTR(?chemblId, 7)) > 3500000)
}
ORDER BY DESC(?chemblId)
LIMIT 30"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?moleculeLabel ?chemblId ?disease ?phase
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  VALUES ?chemblId { "CHEMBL5315119" "CHEMBL5314649" "CHEMBL4650485" "CHEMBL5095034" "CHEMBL4650989" "CHEMBL4650323" }

  ?molecule cco:chemblId ?chemblId ;
            rdfs:label ?moleculeLabel ;
            cco:hasDrugIndication ?indication .

  ?indication cco:hasMeshHeading ?disease ;
              cco:highestDevelopmentPhase ?phase .
}
ORDER BY DESC(?chemblId) DESC(?phase)"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>
PREFIX dcterms: <http://purl.org/dc/terms/>

SELECT ?disease ?label ?notificationNumber
WHERE {
  ?disease a nando:NANDO_0000001 ;
           rdfs:label ?label ;
           nando:hasNotificationNumber ?notificationNumber .
  FILTER(CONTAINS(LCASE(?label), "spinal and bulbar muscular atrophy"))
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>

SELECT ?disease ?label ?notificationNumber
WHERE {
  ?disease rdfs:label ?label ;
           nando:hasNotificationNumber ?notificationNumber .
  FILTER(CONTAINS(LCASE(?label), "spinal") && CONTAINS(LCASE(?label), "bulbar"))
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>

SELECT ?disease ?label ?notificationNumber
WHERE {
  ?disease rdfs:label ?label ;
           nando:hasNotificationNumber ?notificationNumber .
  FILTER(CONTAINS(LCASE(?label), "muscular atrophy"))
}
LIMIT 20
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT ?disease ?label ?notificationNumber
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           rdfs:label ?label ;
           nando:hasNotificationNumber ?notificationNumber .
  FILTER(LANG(?label) = "en")
  ?label bif:contains "'Spinal*'" option (score ?sc) .
}
ORDER BY DESC(?sc)
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT ?disease ?identifier ?en_label ?ja_label ?kegg ?mondo
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           rdfs:subClassOf+ nando:1100001 ;
           dct:identifier ?identifier ;
           rdfs:label ?en_label ;
           rdfs:label ?ja_label ;
           rdfs:seeAlso ?kegg ;
           skos:closeMatch ?mondo .
  FILTER(LANG(?en_label) = "en")
  FILTER(LANG(?ja_label) = "ja" && !REGEX(STR(?ja_label), "^[ぁ-ん]+$"))
  FILTER(CONTAINS(STR(?kegg), "kegg.jp"))
  FILTER(STRSTARTS(STR(?mondo), "http://purl.obolibrary.org/obo/MONDO_"))
}
ORDER BY ?identifier"}}]
